    __webpack_exports__["default"] = "<h2 mat-dialog-title>Creación de posts</h2>\n<mat-dialog-content class=\"mat-typography\">\n\n\n    <h3><span><b>\n        Permisos requeridos\n      </b></span></h3>\n  \n    <h4>Administradores:</h4>\n    <p>Un administrador no requiere permisos del Módulo Social para postear en ninguna página, lo único que necesita es ser \n        administrador de la página (o que la pagina le pertenezca), que la pagina esta agregada en el Módulo Social en la ventana de \n        Administración y que este activa.</p>\n    <h4>Empresarios:</h4>\n    <p>Un empresario requiere ser administrador de la página (o que la pagina le pertenezca) y que un administrador le otorgue permisos\n        sobre esa página en concreto, adicionalmente dicha página debe estar activa.\n\n    </p>\n\n\n  <h3><span><b>\n    Funciones según el tipo de usuario\n  </b></span></h3>\n  <h4>Administradores:</h4>\n    <p>Un administrador puede realizar tanto \"Posteos Admin\" como \"Posteos Pendientes\".</p>\n    <h4>Empresarios:</h4>\n    <p>Un empresario solo puede realizar \"Posteos Pendientes\".\n    </p>\n\n    <h3><span><b>\n        ¿Cómo funciona la creación de posts?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para realizar cualquier tipo de post:</p>\n    <ul>\n        <li>\n            <p>Escribe el contenido o texto que deseas que tenga el post en el recuadro blanco, no puedes postear un post sin texto.</p>\n        </li>\n\n        <li>\n            <p>Selecciona una fecha para para obtener el feedback de Facebook, no puedes postear sin seleccionar una fecha valida. Esta es una sugerencia para indicar cuando deseas que se obtenga\n                la retroalimentación de Facebook. </p>\n        </li>\n\n        <li>\n            <p>Selecciona una imagen para mostrar en el post, su tamaño no debe ser mayor a 10Mb. </p>\n        </li>\n\n        <li>\n            <p>Procede a realizar el tipo de post que desees y para el que poseas permisos. </p>\n        </li>\n\n        <li>\n            <p>\n                Independientemente de tu elección al hacer clic en ambas opciones de posteos se abrirá una ventana de Facebook\n                en la que deberás seleccionar sobre que páginas deseas otorgar permisos a Intelitur, tus páginas se desplegaran, selecciona\n                las que desees, y te pedirá permisos. Esto solo pasara la primera vez puesto que Facebook recordará la configuración en futuras\n                acciones, sin embargo, siempre puedes cambiarla fácilmente cuando se desee (se recomienda agregar todas tus páginas).\n            </p>\n        </li>\n\n        <li>\n            <p>\n                Una vez otorgues los permisos sobre la o las páginas, podrás ver como se muestra una ventana de selección donde puede elegir\n                una o más páginas para postear, el post será idéntico en todas las páginas no importa cuantas páginas se elija.\n            </p>\n        </li>\n\n        <li>\n            <p>La información que ingresaste no se limpiara de los campos, puedes hacer múltiples versiones de un \n                mismo post para que los administradores seleccionen la más adecuada en caso de realizar un Posteo Pendiente.</p>\n        </li>\n    </ul>\n\n\n\n</mat-dialog-content>\n<mat-dialog-actions align=\"end\">\n  <button mat-button mat-dialog-close>Cerrar</button>\n\n</mat-dialog-actions>";
