    __webpack_exports__["default"] = "<h2 mat-dialog-title>Gestión de permisos y páginas</h2>\n<mat-dialog-content class=\"mat-typography\">\n\n\n    <h3><span><b>\n        Permisos requeridos\n      </b></span></h3>\n  \n    <h4>Administradores:</h4>\n    <p>Un administrador no requiere permisos del Módulo Social para realizar ningún tipo de acción en esta ventana.</p>\n    <h4>Empresarios:</h4>\n    <p>Un empresario NO puede acceder a esta ventana.\n    </p>\n\n\n  <h3><span><b>\n    Funciones según el tipo de usuario\n  </b></span></h3>\n  <h4>Administradores:</h4>\n    <p>\n        Un administrador puede agregar permisos a usuarios empresarios sobre distintas páginas, también puede deshabilitar\n                el permiso. Un administrador puede agregar páginas a la aplicación y permitir así su uso a empresarios o administradores,\n                así mismo puede deshabilitar una página temporalmente.\n        \n    </p>\n    <h4>Empresarios:</h4>\n    <p>Ninguna.\n    </p>\n\n    <h3><span><b>\n        ¿Cómo funciona el agregar una página?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para agregar una página:</p>\n    <ul>\n       \n        <li>\n            <p>Haciendo clic en el botón con un signo de \"+\" en la sección de páginas (+). </p>\n        </li>\n\n        <li>\n            <p>\n                Se abrirá una ventana de Facebook\n                en la que deberás seleccionar sobre que páginas deseas otorgar permisos a Intelitur, tus páginas se desplegaran y selecciona\n                las que desees y te pedirá permisos. Esto solo pasara la primera vez puesto que Facebook recordara la configuración en futuras\n                acciones, sin embargo, siempre puedes cambiarla fácilmente cuando se desee.\n\n            </p>\n        </li>\n\n        <li>\n            <p>\n                Una vez otorgues los permisos sobre la o las páginas, podrás ver como se muestra una ventana de selección donde puedes elegir\n                una página para agregar al Modulo Social, solo puedes seleccionar una y esta no debe estar ya agregada en la plataforma.\n\n            </p>\n        </li>\n\n    </ul>\n\n\n    <h3><span><b>\n        ¿Cómo funciona el agregar un permiso a un empresario?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para dar permisos a un usuario:</p>\n    <ul>\n       \n        <li>\n            <p>Haciendo clic en el botón con un signo de \"+\" en la sección de permisos (+).</p>\n        </li>\n\n        <li>\n            <p>\n                Se abrirá una ventana en la cual navegaras entre todos los usuarios de la aplicación, debes seleccionar uno.\n            </p>\n        </li>\n\n        <li>\n            <p>\n                A continuación, veras todas las páginas disponibles en el Módulo Social, debes seleccionar una para indicar que otorgas permisos\n                a ese usuario para esa página.\n\n            </p>\n        </li>\n\n        <li>\n            <p>\n                Seguidamente podrás ver una ventana de confirmación para verificar tu selección, de ser correcta has clic en confirmar.\n            </p>\n        </li>\n\n    </ul>\n\n\n\n</mat-dialog-content>\n<mat-dialog-actions align=\"end\">\n  <button mat-button mat-dialog-close>Cerrar</button>\n\n</mat-dialog-actions>";
