    __webpack_exports__["default"] = "<h2 mat-dialog-title>Gestión de publicaciones</h2>\n<mat-dialog-content class=\"mat-typography\">\n\n\n    <h3><span><b>\n        Permisos requeridos\n      </b></span></h3>\n  \n    <h4>Administradores:</h4>\n    <p>Un administrador no requiere permisos del Módulo Social para hacer uso de las funciones, pero si necesita ser administrador\n        de la página sobre la que quiere administrar en Facebook, esto es necesario para \"Publicar\", \"Ver Post\" y \"FeedBack\". No es necesario para \n        \"Eliminar\".\n    </p>\n    <h4>Empresarios:</h4>\n    <p>Un empresario requiere ser administrador de la página (o que la pagina le pertenezca) y tener permisos en el Módulo social sobre esa página. Solo puede \n        \"Ver Post\".\n\n    </p>\n\n\n  <h3><span><b>\n    Funciones según el tipo de usuario\n  </b></span></h3>\n  <h4>Administradores:</h4>\n    <p>Un administrador puede publicar un post pendiente, eliminar un post pendiente, visualizar posts y obtener el feedback de Facebook, para las\n        páginas en las que sea administrador en Facebook.\n    </p>\n    <h4>Empresarios:</h4>\n    <p>Un empresario solo puede visualizar posts publicados por sigo mismo, para las\n        páginas en las que sea administrador en Facebook.\n    </p>\n\n    <h3><span><b>\n        ¿Cómo funciona eliminar un post pendiente?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para eliminar un post pendiente:</p>\n    <ul>\n        <li>\n            <p>Solo puedes eliminar post pendientes, para eliminar un post pendiente solo debes hacer clic en \"Eliminar\". Un post\n                pendiente eliminado no puede ser posteado, sin embargo, puedes ver el post en \"Ver Post\". </p>\n        </li>\n    </ul>\n\n    <h3><span><b>\n        ¿Cómo funciona ver un post?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para ver posts:</p>\n    <ul>\n        <li>\n            <p>Cualquier tipo de post pendiente o no puede ser visualizado (si eres administrador). Debes hacer clic en \"Ver Post\". </p>\n        </li>\n\n        <li>\n            <p>Se abrirá una ventana de Facebook, la página a la que pertenece el post debe estar seleccionada en los permisos otorgados a\n                Intelitur, no importa la cantidad de páginas que tengas asociadas a Intelitur. </p>\n        </li>\n\n        <li>\n            <p>Terminado el paso anterior podrás visualizar el post. </p>\n        </li>\n    </ul>\n\n\n    <h3><span><b>\n        ¿Cómo funciona publicar un post pendiente?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta para  publicar un post pendiente:</p>\n    <ul>\n        <li>\n            <p>Debes hacer clic en \"Publicar\". </p>\n        </li>\n\n        <li>\n            <p>Se abrirá una ventana de Facebook, la página a la que pertenece el post debe estar seleccionada en los permisos otorgados a\n                Intelitur, no importa la cantidad de páginas que tengas asociadas a Intelitur. </p>\n        </li>\n\n        <li>\n            <p>Terminado el paso anterior podrás visualizar una ventana en la que debes elegir únicamente la página en la que \n                el post fue publicado y clic en continuar.</p>\n        </li>\n\n        <li>\n            <p>No se valida si la página esta activa o no en la aplicación, puesto que cuando se realizó el post pendiente la página\n                si estaba activa.\n            </p>\n        </li>\n\n    </ul>\n\n    <h3><span><b>\n        ¿Cómo funciona obtener el feedback de Facebook?\n      </b></span></h3>\n  <p>La siguiente lista enumera la secuencia correcta obtener el feedback de Facebook:</p>\n    <ul>\n        <li>\n            <p>Debes hacer clic en \"FeedBack\". </p>\n        </li>\n\n        <li>\n            <p>Se abrirá una ventana de Facebook, la página a la que pertenece el post debe estar seleccionada en los permisos otorgados a\n                Intelitur, no importa la cantidad de páginas que tengas asociadas a Intelitur. </p>\n        </li>\n\n        <li>\n            <p>Terminado el paso anterior podrás visualizar una ventana en la que debes elegir únicamente la página en la que \n                el post fue publicado y clic en continuar. </p>\n        </li>\n\n        <li>\n            <p>Podrás visualizar las reacciones actualizadas en \"Ver Post\". </p>\n        </li>\n\n    </ul>\n\n\n\n</mat-dialog-content>\n<mat-dialog-actions align=\"end\">\n  <button mat-button mat-dialog-close>Cerrar</button>\n\n</mat-dialog-actions>";
